University of San Francisco's Data Institute launched in August 2016 with the following
 objectives:

 1. Build an inclusive community of data scientists in the heart of San Francisco to advance
 research in data science and deep learning;

 2. Continue to create innovative curriculum to support the training of the next generation
 of data scientists;

 3. Foster a new paradigm between industry and academia by expanding the relationship between the data science teams at industry partners such as Eventbrite, Salesforce, Vungle and Capital One Labs to tackle industrial data science problems;

 4. Partner with nonprofit and civic organizations to seek data-driven solutions to address
 pressing social, economic and environmental challenges

