The mission of Queen's University has been articulated in a number of different forms and formats over the past decade. In all of the presentations, the key elements have remained constant:

The University will build on the strength that is Queen's - students, faculty, staff and alumni - to be among the best of internationally known universities in Canada, recognized for:

the exceptional quality of undergraduate and graduate students and programs in the arts, sciences and professions;

the intellectual power and value of research and scholarship by faculty members and students;

the exemplary service of the University and that of its graduates to the community and the nation and the community of nations.

Its nature, that of a university with such seminaries of learning as shall make it of the highest grade, including mechanical institutes, museums, galleries of art, laboratories, and conservatories, together with all things necessary for the study of agriculture in all its branches, and for mechanical training, and the studies and exercises directed to the cultivation and enlargement of the mind;

Its object, to qualify its students for personal success, and direct usefulness in life;

And its purposes, to promote the public welfare by exercising an influence in behalf of humanity and civilization, teaching the blessings of liberty regulated by law, and inculcating love and reverence for the great principles of government as derived from the inalienable rights of man to life, liberty, and the pursuit of happiness.

to provide comprehensive undergraduate, graduate, and professional education of the highest quality;
  to carry out research and intellectual endeavors of the highest international standards that advance knowledge and have immediate or long-range practical significance;
  to provide leadership for economic growth, technology, and culture for neighboring communities and the wider geographic region;
  to provide state-of-the-art innovative health care, while serving as a resource to a regional health care network and to the traditionally underserved;
  to fulfill these objectives while celebrating diversity and positioning the University in the global community.

The mission of Universidade NOVA de Lisboa is to serve society on a local, regional and global level. As a university institution that wishes to be a reference, it is focused on the following plans:

An international profile with an emphasis on second and third cycles, but founded on solid first cycles, focused on its students and providing them rigorous knowledge, creativity, critical spirit and sense of citizenship and justice that enables professional success and leadership;
A collaborative investigation, responsible and internationally relevant, concentrating on interdisciplinary areas and including an investigation targeting the resolution of problems that affect society;
A service that promotes solidarity and sustainable development in the health, economic, technological, cultural and social plans, founded in the region of Lisbon and compromised on a national and international level, dedicating special attention to the countries where the Portuguese Language is spoken;
A wide base of interinstitutional participation, oriented to an integration of different scientific cultures with the purpose of creating innovative synergies for teaching and research.

To provide quality higher education easily accesible to everyone;
  Conduct the Tri Dharma (education, research and community service) that is capable to meet the national and global challenges;
  Create highly intellectual graduates with good virtues that can compete globally;
  Creating a nurturing academic climate that will support the realization of the university’s vision.

The University of Pittsburgh, founded in 1787, is one of the oldest institutions of higher education in the United States.  As one of the nation's distinguished comprehensive universities, the resources of the University constitute an invaluable asset for the intellectual, economic, and social enrichment of Pennsylvania, while the international prestige of the University enhances the image of Pennsylvania throughout the world.

 The University's mission is to:

provide high-quality undergraduate programs in the arts and sciences and professional fields, with emphasis upon those of special benefit to the citizens of Pennsylvania;

offer superior graduate programs in the arts and sciences and the professions that respond to the needs of Pennsylvania, as well as to the broader needs of the nation and the world;

engage in research, artistic, and scholarly activities that advance learning through the extension of the frontiers of knowledge and creative endeavor;

cooperate with industrial and governmental institutions to transfer knowledge in science, technology, and health care;

offer continuing education programs adapted to the personal enrichment, professional upgrading, and career advancement interests and needs of adult Pennsylvanians; and

make available to local communities and public agencies the expertise of the University in ways that are consistent with the primary teaching and research functions and contribute to social, intellectual, and economic development in the Commonwealth, the nation, and the world.

The trustees, faculty, staff, students, and administration of the University are dedicated to accomplishing this mission, to which they pledge their individual and collective efforts, determined that the University shall continue to be counted among the prominent institutions of higher education throughout the world.
